    private readonly router: Router
  ) {}

  canLoad(): boolean {
    const isLogged = this.auth.isUserLogged;
    if (!isLogged) {
      this.router.navigate(['/']);
    }
    return isLogged;
  }

  canActivate(): boolean {
    const isLogged = this.auth.isUserLogged;
    if (!isLogged) {
      this.router.navigate(['/']);
    }
    return isLogged;
  }

  private validUserLogged(): boolean {
    const isLogged = this.auth.isUserLogged;
    if (!isLogged) {
      this.auth.logout();
    }

    return isLogged;
  }
}

