export interface AuthRequired {
  correo: string;
  password: string;
}

export interface AuthOptional {
  recaptchaReactive: string;
}

export type AuthProperties = AuthRequired & Partial<AuthOptional>;

export class Auth {
  private readonly correo: string;
  private password: string;
  private recaptchaReactive: string;

  constructor(properties: AuthProperties) {
    Object.assign(this, properties);
  }

  properties(): AuthProperties {
    return {
      correo: this.correo,
      password: this.password,
      recaptchaReactive: this.recaptchaReactive,
    };
  }
}

import { Auth, AuthProperties } from './auth';

export class AuthFactory {
  static create(correo: string, password: string): Auth {
    const recaptchaReactive = 'abc';
    const authProperties: AuthProperties = {
      correo,
      password,
      recaptchaReactive,
    };

    if (correo.trim() === '') {
      throw new Error('Correo no puede ser vaco');
    }

    if (password.trim() === '') {
      throw new Error('Password no puede ser vaco');
    }

    return new Auth(authProperties);
  }
}

