export class Paginator extends MatPaginatorIntl {
  override itemsPerPageLabel = 'Items por pgina:';
  override nextPageLabel = 'SIGUIENTE PGINA';
  override previousPageLabel = 'PGINA ANTERIOR';
  override firstPageLabel = 'PRIMERA PGINA';
  override lastPageLabel = 'LTIMA PGINA';

  override getRangeLabel = (page: number, pageSize: number, length: number) => {
    if (length === 0 || pageSize === 0) {
      return `0 of ${length}`;
    }
    length = Math.max(length, 0);
    const startIndex = page * pageSize;
    const endIndex =
      startIndex < length
        ? Math.min(startIndex + pageSize, length)
        : startIndex + pageSize;
    return `${startIndex + 1} - ${endIndex} de ${length} registros`;
  };
}

